import React from "react";
import adapter from "webrtc-adapter";

export class PeerConnection extends React.Component {
  render() {
    return (
      <div>
        <video ref={this.localVideo}></video>
        <video ref={this.remoteVideo}></video>

        <div>
          <button>Start</button>
          <button>Call</button>
          <button>Hang up</button>
        </div>
      </div>
    );
  }
}
